query: "with dbt_tests as (\n                select\n                    parent_model_unique_id,\n\
  \                    test_column_name\n                from dbt_db.DBT_SAMPLE_elementary.dbt_tests\n\
  \            )\n\n            select \n                parent_model_unique_id as\
  \ model_unique_id,\n                SUM(\n                    case \n          \
  \              when test_column_name is not ? then ?\n                        else\
  \ ?\n                        end\n                ) as column_tests,\n         \
  \        SUM(\n                    case\n                        when test_column_name\
  \ is ? then ?\n                        else ?\n                        end \n  \
  \              )as table_tests\n            from dbt_tests\n            group by\
  \ parent_model_unique_id"
